import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Login from './pages/Login';

function App() {
  <BrowserRouter>
    <Routes>
      <Route path='/login' element={<Login />}></Route>
    </Routes>
  </BrowserRouter>;
}

export default App;
